import DarrowIcon from "../icons/darrow";

function Menu() {
  const position = {
    label: "flex gap-2",
    parent: "relative",
    child: "absolute w-36",
  };
  const design = {
    text: "font-light tracking-wide cursor-pointer",
    texthover: "hover:text-gray-500",
  };

  return (
    <>
      <div>
        <div className={position.label}>
          <h2 className={design.text}>Sort</h2>
          <DarrowIcon />
        </div>
        <div className={position.dropdown}>
          <p className={`${design.text} ${design.texthover}`}>Newest</p>
          <p className={`${design.text} ${design.texthover}`}>
            Price: High to Low
          </p>
          <p className={`${design.text} ${design.texthover}`}>
            Price: Low to High
          </p>
        </div>
      </div>
    </>
  );
}

export default Menu;
